import React from 'react';

class MainContent extends React.Component {

	// getInitialState() {
	// 	return {
	// 		value: 'select'
	// 	}
	// }

	change(e) {	  
		let citySelection = e.target.value;	  
	}

	render(){
		citySelection = this.target.value;
		console.log(citySelection);
		return (
			<div className="flex justify-center content-center h-full p-0 m-0">
				<select className="m-auto" onChange={this.change.bind(this)}>
					<option value="" disabled>Select location</option>
					<option value="New York">New York</option>
					<option value="Los Angeles">Los Angeles</option>
					<option value="Columbus">Columbus</option>
				</select>	
				<p id="city-selection"></p>
			</div>			
		);
	}
}

export default MainContent;
